import React, { useState, useEffect, useRef } from "react";

export default function App() {
  const videoRef = useRef(null);
  const wsRef = useRef(null);

  const [image, setImage] = useState(null);
  const [detections, setDetections] = useState([]);
  const [selectedObject, setSelectedObject] = useState(null);
  const [messages, setMessages] = useState({});
  const [inputMsg, setInputMsg] = useState("");

  // ------------------- WebSocket -------------------
  useEffect(() => {
    const ws = new WebSocket("ws://localhost:7001/ws");
    ws.onopen = () => console.log("WebSocket connected!");

    ws.onmessage = (event) => {
      try {
        const data = JSON.parse(event.data);

        if (data.image && data.detections) {
          setImage(`data:image/jpeg;base64,${data.image}`);
          setDetections(data.detections);
        } else if (data.type === "new_message") {
          const { object_id, message } = data;
          setMessages((prev) => ({
            ...prev,
            [object_id]: [...(prev[object_id] || []), message],
          }));
        }
      } catch (err) {
        console.warn("Non-JSON WebSocket message ignored:", event.data);
      }
    };

    wsRef.current = ws;
    return () => ws.close();
  }, []);

  // ------------------- Camera -------------------
  useEffect(() => {
    navigator.mediaDevices
      .getUserMedia({ video: true })
      .then((stream) => {
        if (videoRef.current) {
          videoRef.current.srcObject = stream;
          const playVideo = async () => {
            try {
              if (videoRef.current.paused) {
                await videoRef.current.play();
              }
            } catch (err) {
              console.error("Video play interrupted:", err);
            }
          };
          playVideo();
        }
      })
      .catch((err) => console.error("Error accessing camera:", err));
  }, []);

  // ------------------- Send frames -------------------
  useEffect(() => {
    const interval = setInterval(() => {
      if (!videoRef.current) return;
      const canvas = document.createElement("canvas");
      canvas.width = 640;
      canvas.height = 480;
      const ctx = canvas.getContext("2d");
      ctx.drawImage(videoRef.current, 0, 0, 640, 480);
      canvas.toBlob(async (blob) => {
        const formData = new FormData();
        formData.append("file", blob, "frame.jpg");
        try {
          await fetch("http://localhost:7001/detect", {
            method: "POST",
            body: formData,
          });
        } catch (err) {
          console.error("Failed to send frame:", err);
        }
      }, "image/jpeg");
    }, 200); // 5 FPS
    return () => clearInterval(interval);
  }, []);

  // ------------------- Send message -------------------
  const sendMessage = () => {
    if (!selectedObject || !inputMsg) return;
    wsRef.current.send(
      JSON.stringify({
        type: "send_message",
        object_id: selectedObject,
        user_id: "user_1",
        text: inputMsg,
      })
    );
    setInputMsg("");
  };

  // ------------------- Render -------------------
  return (
    <div style={{ padding: "20px" }}>
      <h1>📡 AI/ML Real-Time Messaging System</h1>

      {/* Hidden Camera */}
      <video ref={videoRef} style={{ display: "none" }} />

      {/* Detection Image */}
      <div style={{ position: "relative", display: "inline-block" }}>
        {image && <img src={image} alt="Detection" style={{ maxWidth: "800px" }} />}
        {detections.map((det, index) => {
          const [x1, y1, x2, y2] = det.bbox;
          const width = x2 - x1;
          const height = y2 - y1;
          return (
            <div
              key={index}
              onClick={() => setSelectedObject(det.object_id || index)}
              style={{
                position: "absolute",
                left: x1,
                top: y1,
                width,
                height,
                border: "2px solid red",
                cursor: "pointer",
                backgroundColor:
                  selectedObject === (det.object_id || index)
                    ? "rgba(255,0,0,0.2)"
                    : "transparent",
              }}
            >
              {det.class}
            </div>
          );
        })}
      </div>

      {/* Message Box */}
      <div style={{ marginTop: "20px" }}>
        <h3>Selected Object: {selectedObject || "None"}</h3>
        <div
          style={{
            maxHeight: "200px",
            overflowY: "auto",
            border: "1px solid gray",
            padding: "10px",
          }}
        >
          {selectedObject && messages[selectedObject]
            ? messages[selectedObject].map((msg, i) => (
                <div key={i}>
                  <b>{msg.user_id}:</b> {msg.text || msg.plaintext || ""}
                </div>
              ))
            : "No messages yet."}
        </div>
        <input
          type="text"
          value={inputMsg}
          onChange={(e) => setInputMsg(e.target.value)}
          placeholder="Type message..."
        />
        <button onClick={sendMessage}>Send</button>
      </div>
    </div>
  );
}
